function Init()
	if title==true then
		sync(0,7,false)
	end
end

function OVR()
	if inv then
		print("RectX: "..rx,0,0,12)
		print("RectY: "..ry,64,0,12)
	end
	if title==false then
		HUD()
		DrawInv()
	end
end

rw=160 --width of hud area
rl=w/2-rw/2

function HUD()
	--[[get the width of the screen then divide by two to get
	the center. Next subtract the width of the rect then
	divide by two to center the rect on the screen]]
	rect(rl,120,rw,16,7)
	line(rl-1,120,rl-1,136,1)
	line(rl+rw,120,rl+rw,136,1)
	--240/2-160/2
	--rupies
	font(p.rupies,w-rw+rl,128,7,8,8,true,1)
	spr(s.ruppyHUD,w-rw+rl,120,7)
	--hearts
	for num=1,p.maxHP do
		spr(s.eHeart,w-rw+16+rl+8*num,120,7)
	end
	
	for num=1,p.curHP do
		spr(s.fHeart,w-rw+16+rl+8*num,120,7)
	end
	--equipment brackets
	spr(s.B,rl,120,7)
	line(6+rl,121,6+rl,134,1)
	pix(7+rl,121,1)
	pix(7+rl,134,1)
	line(32+rl,121,32+rl,134,1)
	pix(31+rl,121,1)
	pix(31+rl,134,1)
	
	spr(s.A,rl+40,120,7)
	line(46+rl,121,46+rl,134,1)
	pix(47+rl,121,1)
	pix(47+rl,134,1)
	line(72+rl,121,72+rl,134,1)
	pix(71+rl,121,1)
	pix(71+rl,134,1)

	if equip then
		spr(s.shield,rl+9,119,7,1,0,0,1,2)
		spr(s.L,rl+16,128,7)
		font(p.shieldLvl,rl+26,128,7)
	end
end

equip=false

function DrawInv()
	if inv then
	--draw the selector rectangle
		rect(rl,10,rw,110,7) --background rect
		rectb(rl-1,10,rw+2,110,1) --inventory border
		rectb(rx,ry,28,14,9) --47 to 79
		--rect(x,y,w,h,col)
	end
	
	if inv then
		--when menu opens it switches to the first map screen
		--sync(0,membank.inv,false)
		if item[1] then
			DrawEquip(s.shield,false,p.shieldLvl)
			p.equip.shield=true
		end
		if item[2] then
			DrawEquip(s.bow,true,p.bowLvl)
			p.equip.bow=true
		end
	end
end

function Equip()
	if p.hasShield==true then
		--[[maybe create an ID by adding rx and ry
		to know where the selector is and have that ID on
		the equipment]]
		trace(rx)
		trace(ry)
		equip=true
	end
end

function TIC()
	cls(4)
	if title==false and inv==false then
		--18x16 tiles 144,128px / default  30*17,240x136px
		if p.inDun==true then
			map((p.x//240)*30,(p.y//136)*17,30,17,0,0,7,1)
		else
			map((p.x//240)*30,(p.y//136)*17,30,17,0,0,7,1,AnimTiles)
		end
	 spr(p.idx,p.x%240,p.y%136,7,1,p.flp,0,2,2)
		Idle()
		Warp()
		Collectiables()
		--Boomerang()
		ShootArrow()
		Debug()
	else
		cls(4)
		map()
		print("TIC-80 Demo",118,85,2)
		if btnp(c.z) and inv==false then
			title=false
			sync(0,membank.wor,false)
		end
	end

	t=t+2
	Controls()
	
	if keyp(53) then --press ins
		debug=true
	end
	--[[pressing del will load the imported sprites into 
	the membank. Once loaded the sprite sheet can be
	updated without having to do it again.]]
	if keyp(52) then --del
		--sync(0,membank.ui,true)
		slot.x1=slot.x2
	end
	if keyp(54) then --pgup
		p.shieldLvl=p.shieldLvl+1
	end
end

function Debug()
	if debug==true then
		print("X "..p.x,0,0,12)
		print("Y "..p.y,0,8,12)
		print(w,30,0,12)
		print(h,30,8,12)
		print("In Dungeon: "..tostring(p.inDun),0,16,12)
		print("TileX: "..p.x//8,0,24,12)
		print("TileY: "..p.y//8,0,32,12)
		print("Facing: "..p.facing,0,40,12)
		print("Shield: "..tostring(item[1]),0,48,12)
		print("Bow: "..tostring(item[2]),0,56,12)
		print("Array: "..ar,0,64,12)
		print("x1: "..slot.x1,0,72,12)
		print("y1: "..slot.y1,0,72+8,12)
	end
end

function Controls()
	--opens and closes inventory 
	if btnp(c.a) and inv==false and title==false then
		inv=true
		p.canMove=false
		sync(2,membank.inv,false)
	elseif btnp(c.a) and inv==true then
		inv=false
		p.canMove=true
		sync(2,membank.wor,false)--calling the wor membank may cause future issues
	end
	--[[not sure why this is in controls?
	Does it need to be	here]]
	if fget(mget(p.x//8,p.y//8),1) then
		Pit()
	end
	--if the player can move; move Link around
	if p.canMove==true then
		if btn(c.up) and not solid(p.x,p.y-1) and not solid(p.x+15,p.y-1) then
			c_up()
			p.facing="up"
		else
			PushUp()
		end
		
		if btn(c.down) and not solid(p.x,p.y+16) and not solid(p.x+15,p.y+16) then
			c_down()
			p.facing="down"
		else
			canPush=true
			PushDown()
		end
		
		if btn(c.left) and not solid(p.x-1,p.y) and not solid(p.x-1,p.y+15) then 
			c_left()
			p.facing="left"
		else
			canPush=true
			Push() --no idea why this works on the right push also
		end
			
		if btn(c.right) and not solid(p.x+16,p.y) and not solid(p.x+16,p.y+15) then
			c_right()
			p.facing="right"
		end
		
		if btn(c.z) then
			p.idx=416
		end
	end
	--controls the inventory selector
	if inv then
		if btnp(c.right) and rx==47 then
			rx=rx+32
		end
		
		if btnp(c.left) and rx==79 then
			rx=rx-32
		end
		
		if btnp(c.down) and ry<=81 then --down
			ry=ry+16
		end
		
		if btnp(c.up) and ry>=33 then --up
			ry=ry-16
		end
		
		if btnp(c.z) then
			Equip()
		end
	end
end

function solid(x,y)
	return fget(mget(flr(x/8),flr(y/8)),0)
end

function c_up()
	if p.equip.shield then
		p.idx=388+t%60//30*2
	else
		p.idx=s.faceUp+t%60//30*2
	end
	p.idle=false
	p.y=p.y-1
end

function c_down()
	if p.equip.shield then
		p.idx=384+t%60//30*2
	else
		p.idx=s.faceDown+t%60//30*2
	end
	p.idle=false
	p.y=p.y+1
end

function c_left()
	p.idx=264+t%60//30*2
	p.flp=0
	p.idle=true
	p.x=p.x-1
end

function c_right()
	if p.equip.shield then
		p.idx=392+t%60//30*2 --sprite is shield facing right
		p.flp=0
		--equipping shield breaks idle and forces link to idle looking left.
	else
		p.idx=s.faceSide+t%60//30*2 --sprite 264
		p.flp=1
	end
	p.idle=true
	p.x=p.x+1
end

function Push()
	if btn(c.left) or btn(c.right) and not p.equip.shield then
		p.idx=s.push+t%60//30*2
		p.idle=true
	elseif btn(c.left) or btn(c.right) and p.equip.shield then
		p.idx=s.push+t%60//30*2
		p.idle=true
		p.flp=1
	end
end

function PushUp()
	if btn(c.up) then
		p.idx=s.pushUp+t%60//30*2
	end
end

function PushDown()
	if btn(c.down) then
		p.idx=s.pushDown+t%60//30*2
	end
end

function Idle()
	if p.idle==true and not btn(2) and not btn(3) and not p.equip.shield then
		p.idx=s.faceSide
	elseif p.idle==true and not btn(2) and not btn(3) and p.equip.shield then
		if p.facing=="right" then
			p.idx=392
		elseif p.facing=="left" then
			p.idx=s.faceSide
		end
	end
end

function ShootArrow()
	if a.active then
		if p.facing=="left" or p.facing=="right" then
			a.x=a.x+a.vx
		elseif p.facing=="up" or p.facing=="down" then
			a.y=a.y+a.vy
		end
		
		if not solid(a.x,a.y) then
			spr(s.arrow,a.x%240,a.y%136,7,1,0,a.rot,2,2)
		else
			a.active=false
			p.canMove=true
		end
	
	elseif btnp(c.z) and p.hasBow then
		a.active=true
		p.canMove=false
		
		if p.facing=="right" then
			a.x= p.x+9
			a.vx=a.spd*2
			a.rot=1
			p.idx=s.useSide+t%60//30*2
		elseif p.facing=="left" then
			a.x=p.x-9
			a.vx=a.spd*-2
			a.rot=3
			p.idx=s.useSide+t%60//30*2
		elseif p.facing=="up" then
			a.y=p.y+9
			a.vy=a.spd*-2
			a.rot=0
			p.idx=s.useUp+t%60//30*2
		elseif p.facing=="down" then
			a.y=p.y-9
			a.vy=a.spd*2
			a.rot=2
			p.idx=s.useDown+t%60//30*2
		end

		a.x=p.x
		a.y=p.y
	end
end

function Pit()
	--[[this needs to have player direction added to it]]
	p.curX=p.x
	p.curY=p.y
	p.canMove=false
	p.idx=352+t%30//5
	if p.idx>356 then
		p.x=p.curX
		p.y=p.curY-16
		p.canMove=true
		p.idx=s.faceDown
	end
end

function Owl()
	spr(owl,180,40,7,1,0,0,2,2)
end

function Warp()
	--[[this does not work with flags that also are
	on set on collectibles]]
	if fget(mget(p.x//8,p.y//8),1) then
		if p.inDun==false then
			p.curX=p.x
			p.curY=p.y+8
			p.x=sav.x1
			p.y=sav.y1
		end
	end
	--this enables the player to return to where they entered
	if fget(mget(p.x//8,p.y//8),2) then
		p.x=p.curX
		p.y=p.curY
		sync(0,membank.wor,false) --1
		p.inDun=false
	end

	if fget(mget(p.x//8,p.y//8),3) then
		p.curX=p.x
		p.curY=p.y+8
		p.x=d.x
		p.y=d.y
		sync(0,membank.d1,false)
		p.inDun=true
	end
end

function Collectiables()
	if fget(mget(p.x/8 and p.x/8+1,p.y/8 and p.y/8+1),7 and 4) then
		mset(p.x/8+1,p.y/8+1,16)
		p.rupies=p.rupies+1
		--sfx(01,'E-6',5)
	end

	if fget(mget(p.x/8 and p.x/8+1,p.y/8 and p.y/8+1),7 and 6) then
		mset(p.x/8+1,p.y/8+1,16)
		p.curHP=p.curHP+1
	end
	
	if fget(mget(p.x/8 and p.x/8+1,p.y/8 and p.y/8+1),7 and 5) then
		mset(p.x/8+1,p.y/8+1,16)
		table.insert(item,ar)
		ar=ar+1
		--p.hasShield=true
	end
end

--Tools and helper functions

--Enables animated background tiles
function AnimTiles(animTile)
	local outTile,flip,rotate=animTile,0,0
	local at=tileAnims[animTile]
		if at then
			outTile=outTile+flr(t*at.s)%at.f
		end
		return outTile,flip,rotate
end
--Draws all needed items for equipment
function DrawEquip(espr,lspr,lvl)
	--Slot 1: rx:47 ry:17
	--Slot 2: rx:79 ry:17
	--x1+2 is 49 and y1-1 16
	--for k,v in pairs(item) do
	if ar==1 then
		espr=spr(espr,slot.x1+2,slot.y1-1,0,1,0,0,1,2)
		if lspr==true then
			lspr=spr(s.L,57,22,7)
			lvl=font(lvl,66,22,7)
		end

	end
	--end
end

